import React, {Fragments, useState} from "react";

const Listado = () =>{
    
    const [numeros, setNumero] = useState([1,2,3,4,5])
    return(
        <Fragments>
            <ul>
                {
                    numeros.map( (item, index) =>
                        <li key={index}>
                            {item} - {index}

                        </li>
                    )
                }
            </ul>
        </Fragments>
    )
}
export default Listado
